var webClient;

webClient = angular.module('webClient', ['ngRoute', 'ui.bootstrap']);

webClient.config([
  '$routeProvider', function($routeProvider) {
    return $routeProvider.when('/', {
      templateUrl: '/pages/index',
      controller: 'indexCtrl'
    }).when('/room/:id', {
      templateUrl: function(params) {
        return "/pages/room/" + params.id;
      },
      controller: 'roomCtrl'
    }).otherwise({
      redirectTo: '/'
    });
  }
]);

webClient.controller('indexCtrl', [
  '$scope', '$location', 'socket', function($scope, $location, socket) {
    return $scope.joinRoom = function() {
      socket.on('room joined', function(roomid) {
        $scope.loading = true;
        return $location.url("/room/" + roomid);
      });
      return socket.emit('join room', {
        nickname: $scope.nickname,
        room_id: $scope.room_id
      });
    };
  }
]);

webClient.controller('roomCtrl', [
  '$scope', '$rootScope', '$routeParams', '$q', '$location', 'socket', function($scope, $rootScope, $routeParams, $q, $location, socket) {
    var playersInit, roomInit;
    if ($rootScope.player == null) {
      $location.url('/');
    }
    roomInit = $q.defer();
    playersInit = $q.defer();
    $scope.loading = true;
    $q.all([roomInit.promise, playersInit.resolve]).then(function() {
      return $scope.loading = false;
    });
    $scope.room = {};
    $scope.room.id = $routeParams.id;
    socket.on('room', function(room) {
      roomInit.resolve();
      $scope.room = JSON.parse(room);
      return $scope.$apply();
    });
    socket.on('players', function(players) {
      playersInit.resolve();
      $scope.players = JSON.parse(players);
      return $scope.$apply();
    });
    socket.emit('get room', $scope.room.id);
    socket.emit('get waiting players', $scope.room.id);
    socket.on('room left', function() {
      socket.removeAllListeners('room left');
      $location.url('/');
      return $scope.$apply();
    });
    return $scope.leaveRoom = function() {
      $scope.loading = true;
      return socket.emit('leave room', $rootScope.player.id);
    };
  }
]);

webClient.controller('roomsCtrl', [
  '$scope', '$rootScope', '$location', '$uibModal', '$uibModalStack', 'socket', function($scope, $rootScope, $location, $uibModal, $uibModalStack, socket) {
    $scope.loading = true;
    socket.on('rooms', function(rooms) {
      $scope.rooms = JSON.parse(rooms);
      $scope.loading = false;
      return $scope.$apply();
    });
    socket.emit('get rooms');
    socket.on('err', function(error) {
      var errModal;
      socket.removeAllListeners('error');
      $uibModalStack.dismissAll();
      $scope.loading = false;
      return errModal = $uibModal.open({
        templateUrl: 'errorModal',
        controller: 'errorModalCtrl',
        size: 'sm',
        resolve: {
          error: function() {
            return error;
          }
        }
      });
    });
    $scope.joinRoom = function(room) {
      var authModal;
      authModal = $uibModal.open({
        templateUrl: 'authModal',
        controller: 'authModalCtrl',
        size: 'sm',
        resolve: {
          title: function() {
            return room.name;
          }
        }
      });
      return (function(room) {
        return authModal.result.then(function(nickname) {
          $scope.loading = true;
          socket.on('logged', function(player) {
            socket.removeAllListeners('logged');
            if (typeof player === 'string') {
              player = JSON.parse(player);
            }
            console.log(player);
            $rootScope.player = player;
            $location.url("/room/" + room.id);
            return $scope.$apply();
          });
          return socket.emit('login', {
            nickname: nickname,
            room_id: room.id
          });
        });
      })(room);
    };
    return $scope.createRoom = function() {
      var createRoomModal;
      createRoomModal = $uibModal.open({
        templateUrl: 'createRoomModal',
        controller: 'createRoomModalCtrl',
        size: 'sm'
      });
      return createRoomModal.result.then(function(name) {
        $scope.loading = true;
        return socket.emit('create room', {
          name: name
        });
      });
    };
  }
]);

webClient.controller('authModalCtrl', [
  '$scope', '$uibModalInstance', 'title', function($scope, $uibModalInstance, title) {
    $scope.title = title;
    return $scope.ok = function() {
      return $uibModalInstance.close($scope.nickname);
    };
  }
]);

webClient.controller('errorModalCtrl', [
  '$scope', '$uibModalInstance', 'error', function($scope, $uibModalInstance, error) {
    $scope.error = error;
    return $scope.ok = $uibModalInstance.close;
  }
]);

webClient.factory('socket', [
  '$rootScope', '$q', '$http', function($rootScope, $q, $http) {
    var EVENTS, eventReady, socket, socketReady;
    socketReady = $q.defer();
    eventReady = $q.defer();
    EVENTS = null;
    socket = io.connect();
    socket.on('connect', function() {
      return socketReady.resolve();
    });
    $http.get('/api/events').then(function(response) {
      EVENTS = response.data;
      return eventReady.resolve();
    });
    return {
      on: function(event, cb) {
        return $q.all([socketReady.promise, eventReady.promise]).then(function() {
          return socket.on(EVENTS[event], cb);
        });
      },
      emit: function(event, data) {
        return $q.all([socketReady.promise, eventReady.promise]).then(function() {
          return socket.emit(EVENTS[event], data);
        });
      },
      removeAllListeners: function(event) {
        return socket.removeAllListeners(EVENTS[event]);
      }
    };
  }
]);
